import React from 'react';
import insta from '../img/logo_insta.png'

export default class Footer extends React.Component{
    render(){
        return(
            <div className="footer">
                <p className="copyright">
                    Portfolio 2020 &copy; Copyrights reserved.
                </p>
                <ul>
                    <li><a href="https://www.instagram.com/aannaassalam/"><img src="../img/logo_insta.png" alt="Instagram"/></a></li>
                    <li><a href="https://www.facebook.com/anasalam027/"><img src="../img/logo_fb.png" alt="Facebook"/></a></li>
                    <li><a href="https://twitter.com/aannaassalam/"><img src="../img/logo_twitter.png" alt="Twitter"/></a></li>
                    <li><a href="https://www.linkedin.com/in/anas-alam-0207331b2/"><img src="../img/logo_in.png" alt="LinkDin"/></a></li>
                </ul>
            </div>
        )
    }
}
